    "helpContents": "Редактор Map BBCode\nВы нашли редактор и открыли справку, так что уже понимаете, что к чему. Слева кнопки для рисования точек и линий, выбираете, кликаете на карту — появляются объекты. Во всплывающих панелях, открываемых кликом, можно изменить цвет или подпись. Для сохранения карты нажмите «Вставить код», иначе есть кнопка «Отменить».\nНужно знать, что вы редактируете не карту, а её код bbcode, со всеми присущими ему ограничениями. Это обычный текст, который можно скопировать на другой сайт или редактировать напрямую. <a href=\"http://mapbbcode.org/ru/bbcode.html\" target=\"mapbb\">Формат</a> довольно прост: тег <tt>[map]...[/map]</tt> со списком объектов, каждый — последовательность координат и набор атрибутов. Когда курсор находится внутри кода, редактор открывается с картой, которую описывает этот код, иначе он будет пустым.\nПри наличии доступа в интернет прочитайте «<a href=\"http://mapbbcode.org/ru/guide.html\" target=\"mapbb\">руководство пользователя</a>» на сайте MapBBCode.\n\n# По карте как по маслу\nУправление панелями карты очевидно, но есть несколько хитростей. Клавиатурные стрелки работают, когда карта в фокусе. Выделите прямоугольник мышкой с зажатым shift, чтобы быстро приблизить область. Клик с shift на кнопках масштабирования делает их быстрее. Переключатель слоёв справа вверху переключает картографические подложки. Колесо мыши отключено в просмотре, но в редакторе им удобно быстро менять масштаб. Кнопка с лупой скрывает поиск: найдите там нужный город или улицу.\n\n# Внешние карты\nЕсли администраторы не отключили эту функцию, вы можете загружать карты на внешний сервер — по умолчанию <a href=\"http://share.mapbbcode.org\" target=\"mapbb\">share.mapbbcode.org</a> — кнопкой «На сервер». Нажав её на пустой карте, вы увидите поле ввода URL или идентификатора карты с сервера. Они преобразуются в код <tt>[mapid]id[/mapid]</tt>: результат выглядит как обычная карта, но с кнопкой скачивания, которая предлагает много форматов, включая GPX и CSV. Поделившись ссылкой на редактирование карты, вы сможете работать над ней совместно, а изменения автоматически отобразятся на встроенных картах.\n\n# Модуль\n<a href=\"http://mapbbcode.org/ru/\" target=\"mapbb\">MapBBCode</a> — библиотека на javascript с открытым исходным кодом; для некоторых движков форумов и блогов есть плагины, её задействующие. Её миссия — сделать обмен картами проще. Версия модуля {version}.\n"
